// productAction.js
export const FETCH_MEDICINE_PRODUCTS_REQUEST = "FETCH_MEDICINE_PRODUCTS_REQUEST";
export const FETCH_MEDICINE_PRODUCTS_SUCCESS = "FETCH_MEDICINE_PRODUCTS_SUCCESS";
export const FETCH_MEDICINE_PRODUCTS_FAILURE = "FETCH_MEDICINE_PRODUCTS_FAILURE";

export function fetchMedicineProductsRequest() {
  return { type: FETCH_MEDICINE_PRODUCTS_REQUEST };
}

export function fetchMedicineProductsSuccess(data) {
  return { type: FETCH_MEDICINE_PRODUCTS_SUCCESS, data };
}

export function fetchMedicineProductsFailure(error) {
  return { type: FETCH_MEDICINE_PRODUCTS_FAILURE, error };
}
